import React from 'react'

function ChildComponent(props) {

    function clickHandler() {
        props.greetHandler('asd')
    }

    return (
        <div>
            <input />
            <button onClick={clickHandler}>Greet Parent</button>
        </div>
    )
}

export default ChildComponent
